void testEqualTriangulations(std::vector<int> correct, std::vector<int> easy_delaunay, int n)
{
    // Internal function
    auto sortElementConnectivity = [](std::vector<int> &conn, int n)
    {
        std::vector<int> sorted((int)conn.size());
        int n_elems = (int)conn.size() / n;
        for (int elem_i = 0; elem_i < n_elems; elem_i++) {

            int outer_min = -99999;
            for (int outer = 0; outer < n; outer++) {
                int inner_min = 99999;
                int inner_min_node_i;
                for (int inner = 0; inner < n; inner++) {
                    if ((conn[n*elem_i + inner] > outer_min) && (conn[n*elem_i + inner] < inner_min)) {
                        inner_min = conn[n*elem_i + inner];
                        inner_min_node_i = inner;
                    }
                }
                sorted[n*elem_i + outer] = conn[n*elem_i + inner_min_node_i];
                outer_min = inner_min;
            }
        }
        return sorted;
    };

    // Test for size
    if (correct.size() != easy_delaunay.size()) {
        std::cout << "Delaunay test failed!" << std::endl;
        abort();
    }

    // Simplex-wise sort the connectivity
    correct = sortElementConnectivity(correct, n);
    easy_delaunay = sortElementConnectivity(easy_delaunay, n);

    // Compare the two lists
    std::vector<int> sorted((int)correct.size());
    int n_elems = (int)correct.size() / n;
    for (int elem_i = 0; elem_i < n_elems; elem_i++) {
        bool found = false;
        for (int elem_j = 0; elem_j < n_elems; elem_j++) {
            bool equal = true;
            for (int i = 0; i < n; i++) {
                if (correct[n*elem_i + i] != easy_delaunay[n*elem_j + i]) {
                    equal = false;
                    break;
                }
            }
            if (equal) {
                found = true;
                break;
            }
        }
        if (!found) {
            std::cout << "Delaunay test failed!" << std::endl;
            abort();
        }
    }
}
